import React from 'react';
import './App.css';

function App() {

function getResult() {


    var myHeaders = new Headers();

myHeaders.append("Authorization", "Token token='a5o4wu2Ghgnehh_kX79193wPTv9bD4A72hY5mtzv'");
myHeaders.append("X-Api-Version", "20210218");
 const requestOptions:any = {
  method: 'GET',
  headers: myHeaders,
  redirect: 'follow'
};


fetch("https://api.teamtailor.com/v1/custom-field-values", requestOptions)
    .then((response:any) => JSON.stringify(response))
    .then((result:String) => console.log("Result" + result))
  .catch(error => console.log('error', error));


    return (<div>
          result
        </div>)
}






  return (
    <div className="App">
          Here we go:
      <div >
          { getResult() }
            </div>

    </div>
  );
}

export default App;
